import {useHistory} from "react-router-dom";
export default function MyBranch(){

    const history = useHistory();
    function HandleSubmit(event){
        event.preveDefault();
        history.push("/home");

    }

    return(
       <div className="container">
        <div className="row">
           
           
            <div className="col-md-6 offset-md-4 bg-white mt-3 rounded">
            <form action="/add" method="post" onSubmit={HandleSubmit}>
                <h1 className="text-center">Register Bank here</h1>
                {/* bank name */}
                <div class="mb-3">
                  <label for="name" class="form-label">Bank Name</label>
                  <input type="text" name="name" id="name" class="form-control" />
                </div>
                 {/* post office */}
                 <div class="mb-3">
                  <label for="post_office" class="form-label">Post Office Name</label>
                  <input type="text" name="post_office" id="post_office" class="form-control" />
                </div>
                 {/* district */}
                 <div class="mb-3">
                  <label for="district" class="form-label">District Name</label>
                  <input type="text" name="district" id="district" class="form-control" placeholder=""/>
                </div>
                 {/* state */}
                 <div class="mb-3">
                  <label for="state" class="form-label">State Name</label>
                  <input type="text" name="state" id="state" class="form-control" placeholder=""/>
                </div>
                 {/* Ifsc code */}
                 <div class="mb-3">
                  <label for="ifsc_code" class="form-label">Enter Ifsc Code</label>
                  <input type="text" name="ifsc_code" id="ifsc_code" class="form-control" placeholder=""/>
                </div>
                 {/* Pin code */}
                 <div class="mb-3">
                  <label for="pin_code" class="form-label">Enter Pin Code</label>
                  <input type="number" name="pin_code" id="pin_code" class="form-control" placeholder=""/>
                </div>

                 {/* bank name */}
                 <div class="mb-3 text-center">
                  <button type="submit" class="btn btn-success btn-lg " >submit</button>
                  <button type="reset" class="btn btn-success btn-lg ms-4 px-4 ">reset</button>
                </div>

                </form>
           
            </div> 
        
        
        </div>
       </div>
    );
}
